import React from "react";


function Attribute(props) {
    return (
        <React.Fragment>
            <h6>Hello, {props.number}</h6>
            <label htmlFor="Attribute{props.number}">Attribute {props.number}</label>
            <input type="text" className="form-control" id="Name"/>
            <label htmlFor="Beschreibung">Value {props.number}</label>
            <input type="text" className="form-control" id="Beschreibung"/>
        </React.Fragment>
    )
}

export default Attribute
